■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。 その場合はご連絡させて頂きますので予めご了承ください<br><strong><font color="#FF0000" size="+1">ご注文後4～5営業日後の出荷となります（土日除く）</font></strong><table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">さらっとした素材でストレッチ性もばつぐん！暑い季節にもべたつきにくく、さらっとはけて気持ちいい♪足首がキレイに見える丈で美脚効果も。</font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td width="25%" align="center" bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><td width="75%" align="left"><font color="#333333" size="-1">M、L、LL</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" bgcolor="#FFFFCC"><font color="#333333" size="-1">カラー</font></td><td align="left"><font color="#333333" size="-1">ブラック</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" bgcolor="#FFFFCC"><font color="#333333" size="-1">素材・材質</font></td><td align="left"><font color="#333333" size="-1">ポリエステル85％、ポリウレタン15％<br>ボタン：真鋳</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td><td align="left"><font color="#333333" size="-1">中国</font></td></tr></table><!--ab--><style type="text/css">
/*買い物かごに入れるボタン*/
div#rakutenLimitedId_aroundCart input.rCartBtn, 
div#rakutenLimitedId_aroundCart input.rCartBtn[type="submit"] {
    width: 330px !important;
    height: 80px !important;
    cursor: pointer !important;
    background: url("http://image.rakuten.co.jp/yoimonohonpo/cabinet/03133889/imgrc0068400933.jpg")no-repeat 0 0 !important;
}

div#rakutenLimitedId_aroundCart input.rCartBtn,
div#rakutenLimitedId_aroundCart input.rCartBtn[type="submit"]:hover {
    background: url("http://image.rakuten.co.jp/yoimonohonpo/cabinet/03133889/imgrc0068400934.jpg")no-repeat 0 0 !important;
}
</style>

